import React from 'react'
import Input from '../Input/Input'

const ForgotPassword = () => {
  return (
    <div>
      <div>
        <Input
          type="email"
          label="Email"
          {...register('email', {
              required: true,
              pattern: {
                  value: /^[\w-]+@([\w-]+\.)+[\w-]{2,63}$/i, 
                  message: 'Email Is Not Valid'
              },
          })}
          error={errors.email}
          autocomplete="email"
      />
      <FontAwesomeIcon icon={faEnvelope} className={classes.icon1} />
  </div>
    </div>
  )
}

export default ForgotPassword
